import React, { Component } from 'react';

class Headline extends Component {

	constructor(props) {
		super(props);
	}

	render() {

		const {header, desc} = this.props;

		return(
			<div className="headline-container">
				<h1>}{header}</h1>
			</div>
		);
	}
}

export default Headline;
